import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App'
import './config/i18n';


ReactDOM.render(
  <React.StrictMode>
    <Suspense fallback={<div>Loading...</div>}>
      <App />
    </Suspense>
  </React.StrictMode>,
  document.getElementById("root")
);
